import React from 'react';
import Card from './Card';

const CardList = ({ robots }) => {
    if (true) {
        throw new Error ("error occurred");
    }
    return (
        <div>
            {
                robots.map((user, i) => {
                    return (
                        <Card
                            key={robots[i].id} 
                            id={robots[i].id} 
                            name={robots[i].name} 
                            city={robots[i].city} 
                            username={robots[i].username} />
                    );
                })
            }
        </div>
    );
};

export default CardList;
